import React from "react";
import ExpencseDes from "../main/components/ExpencseDes";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Expence = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };
  return (
    <div className="relative" id="images">
      <div className="bg-gray-200 flex justify-evenly mt-24 max-w-screen-xl mx-auto p-8 rounded-lg">
        <div className="flex flex-col mr-20">
          <h1 className="text-gray-600 font-semibold text-3xl mt-8">
            SAVE TIME AND MONEY
          </h1>
          <p className="text-blue-900 text-4xl mt-4">
            Find My Trials reduce expenses, accelerate <br />
            research, and yield quicker advancements, <br />
            ultimately saving both time and money.
          </p>
        </div>
        <div className="mt-8">
          <img
            className="w-64 h-64 object-cover"
            src="images/Group.png"
            alt="group"
          />
        </div>
        <div className="mt-8">
          <img
            className="w-64 h-64 object-cover"
            src="images/Group1.png"
            alt="group"
          />
        </div>
      </div>
      <Slider
        {...settings}
        className="absolute bottom-8 left-1/2 transform -translate-x-1/2"
      >
        {[1, 2, 3].map((index) => (
          <div key={index}>
            <ExpencseDes />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Expence;
